import React from 'react'
import { useRef } from 'react';
import { Button, Row, Col, Container, Card, FormGroup, Input } from 'reactstrap';

const EyeWishList = ({eyeList, handleCheckboxChange, isItemChecked}) => {

    const useRefName = useRef()

  return (
    <div>
        <h5>눈 건강</h5>
        <FormGroup>
        <Container>
            <Row className="m-t-40 justify-content-center">
        {eyeList.map((item)=>(
                <Col lg="4" md="6">
                    <Input ref={useRefName} value={item.wishlist.product_id} name="eyeCk" type="checkbox"></Input>
                    <Card>
                        <img className="card-img-top" alt="wrappixel kit" src={item.wishlist.img}/>
                        <h5 className="font-medium m-t-30">{item.wishlist.detail_name}</h5>
                        <p className="m-t-20">{item.wishlist.detail_price}원</p>
                        <p className="m-t-20">{item.wishlist.manufacturer}</p>
                    </Card>
                </Col>
        ))}
        </Row>
        </Container>
        </FormGroup>
    </div>
  )
}

export default EyeWishList
